import React from 'react'
import {Link} from 'react-router-dom'

export default function Navbar(){
    return(
        <div>
        <Link to='/home'>Home</Link>
        <Link to='/auth'>Register</Link>
        <Link to='/auth/login'>Login</Link>
        </div>
    )
}
